    $('#website').on('click', '.website_response-next', function() {
        var isId = $(this).parent().parent().data('id');
        var nextId = isId + 1;
        var numberItems = $('.website_header-item').length;
        if (nextId <= numberItems) {
            $('#website_etape').text('Etape ' + nextId);
            $('#website_question-' + (nextId - 1)).hide();
            $('#website_question-' + nextId).show();
            $('.website_header-item').removeClass('website_header-item-active animated rubberBand');
            $('#website_header-item-' + nextId).addClass('website_header-item-active animated rubberBand');

            var price = $('#website_question-' + nextId).find('.website_response-select').val().split("|");
            websitePrices.push(parseFloat(price[1]));
            var websiteTotal = 0;
            for (var i = 0; i < websitePrices.length; i++) {
                websiteTotal += websitePrices[i];
            }
            $('#website_bottom-price').text(websiteTotal.toFixed(2).replace('.',','));
        } else {
            $('#website_header').hide();
            $('#website_questions').hide();
            $('#website_bottom').hide();
            $('.website_question').each(function(index, el) {
                var title = $(this).find('.website_question-title').text().trim();
                var value = $(this).find('.website_response-select option:selected').text().trim();
                $('#website_end-table').append('<tr><td>' + title + '</td><td>' + value + '</td></tr>');
            });
            var websiteTotal = 0;
            for (var i = 0; i < websitePrices.length; i++) {
                websiteTotal += websitePrices[i];
            }
            $('#website_end-price').text(websiteTotal.toFixed(2).replace('.',','));
            $('#website_end').show();
            $('#website_etape').text('Rcapitulatif');
        }
    });

    $('#website').on('click', '.website_response-prev', function() {
        var isId = $(this).parent().parent().data('id');
        var prevId = isId - 1;
        if (prevId >= 1) {
            $('#website_etape').text('Etape ' + prevId);
            $('#website_question-' + (prevId + 1)).hide();
            $('#website_question-' + prevId).show();
            $('.website_header-item').removeClass('website_header-item-active animated rubberBand');
            $('#website_header-item-' + prevId).addClass('website_header-item-active animated rubberBand');

            websitePrices.pop();
            var websiteTotal = 0;
            for (var i = 0; i < websitePrices.length; i++) {
                websiteTotal += websitePrices[i];
            }
            $('#website_bottom-price').text(websiteTotal.toFixed(2).replace('.',','));
        } else {
            $('#website_header').remove();
            $('#website_questions').remove();
            $('#website_bottom').remove();
            $('#website_type').show();
            $('#website_etape').text('Site internet');
        }
    });

